Enums, similar to primitive types, are represented by instances of the DynamicSymbol class. Reading an enum’s value involves calling the ReadValue() method. Since PLC enums are represented by their underlying numeric type (e.g., byte, ushort, int, etc.), it’s best to specify the numeric type directly in the PLC code to maintain consistency between the PLC and .NET. Here’s an example of an enum type in Structured Text with UINT as its underlying type: TYPE E_Value :
( _ := 0, Summer, Autumn, Winter, Spring
) UINT;
END_TYPE This setup allows for consistent casting to the correct numeric type in .NET when reading or writing values.

