To set an enum value, use the WriteValue(Object) method. You can either pass the integer representation directly or use .NET features to translate the enum member to its numeric value. Here’s how to set eValue to Autumn, which corresponds to 2: MAIN.eValue.WriteValue(2); Alternatively, if you prefer converting an enum name to its numeric equivalent, the IDataTypeCollection and IEnumType interfaces allow for parsing: var enumType = (IEnumType)symbolLoader.DataTypes["E_Value"];
var enumValue = (ushort)enumType.Parse("Autumn");
MAIN.eValue.WriteValue(enumValue);

