You can retrieve a list of available methods using the RpcMethods property. This property provides an IRpcMethodCollection , containing instances of IRpcMethod for each RPC method available on the symbol. Each IRpcMethod instance provides details like the method name, parameters, return type, and additional comments, making it easy to inspect and understand the functionality of each RPC method. The following example demonstrates how to list the available RPC methods for two PLC symbols, fbValue and ipValue: Console.WriteLine("RPC Methods for fbValue:");
foreach (IRpcMethod method in MAIN.fbValue.RpcMethods)
{ Console.WriteLine(method.Name);
} Console.WriteLine("\nRPC Methods for ipValue:");
foreach (IRpcMethod method in MAIN.ipValue.RpcMethods)
{ Console.WriteLine(method.Name);
}

